import React from "react";
import { Drawer, List, ListItem, ListItemIcon, ListItemText, Divider, Toolbar, Typography } from "@mui/material";
import DashboardIcon from "@mui/icons-material/Dashboard";
import CloudUploadIcon from "@mui/icons-material/CloudUpload";
import ShowChartIcon from "@mui/icons-material/ShowChart";
import ScienceIcon from "@mui/icons-material/Science";
import PlayCircleIcon from "@mui/icons-material/PlayCircle";
import FindInPageIcon from "@mui/icons-material/FindInPage";
import CheckCircleIcon from "@mui/icons-material/CheckCircle";
import BuildCircleIcon from "@mui/icons-material/BuildCircle";
import CampaignIcon from "@mui/icons-material/Campaign";
import DirectionsCarIcon from "@mui/icons-material/DirectionsCar";
import CleaningServicesIcon from "@mui/icons-material/CleaningServices";
import PlaceIcon from "@mui/icons-material/Place";

const drawerWidth = 240;

const navLinks = [
  { label: "Dashboard", icon: <DashboardIcon /> },
  { label: "Input Upload", icon: <CloudUploadIcon /> },
  { label: "Data Prediction", icon: <ShowChartIcon /> },
  { label: "ML Analysis", icon: <ScienceIcon /> },
  { label: "Simulation", icon: <PlayCircleIcon /> },
  { label: "Train Audit", icon: <FindInPageIcon /> },
];

const dataModules = [
  { label: "Fitness Certificates", icon: <CheckCircleIcon /> },
  { label: "Job-Card Status", icon: <BuildCircleIcon /> },
  { label: "Branding Priorities", icon: <CampaignIcon /> },
  { label: "Mileage Balancing", icon: <DirectionsCarIcon /> },
  { label: "Cleaning & Detailing", icon: <CleaningServicesIcon /> },
  { label: "Stabling Geometry", icon: <PlaceIcon /> },
];

function Sidebar() {
  return (
    <Drawer
      variant="permanent"
      sx={{
        width: drawerWidth,
        flexShrink: 0,
        [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: "border-box" },
        zIndex: 10,
      }}
    >
      <Toolbar sx={{ my: 1 }}>
        <DashboardIcon color="primary" sx={{ mr: 1 }} />
        <div>
          <Typography fontWeight={700} variant="body1" lineHeight={1}>Railway Ops</Typography>
          <Typography fontSize={12} color="text.secondary">Management System</Typography>
        </div>
      </Toolbar>
      <Divider />
      <List>
        <Typography variant="subtitle2" sx={{ pl: 2, pt: 1, pb: 0 }}>
          Main Navigation
        </Typography>
        {navLinks.map(item => (
          <ListItem button key={item.label}>
            <ListItemIcon>{item.icon}</ListItemIcon>
            <ListItemText primary={item.label} />
          </ListItem>
        ))}
      </List>
      <Divider />
      <List>
        <Typography variant="subtitle2" sx={{ pl: 2, pt: 1, pb: 0 }}>
          Data Modules
        </Typography>
        {dataModules.map(item => (
          <ListItem button key={item.label}>
            <ListItemIcon>{item.icon}</ListItemIcon>
            <ListItemText primary={item.label} />
          </ListItem>
        ))}
      </List>
    </Drawer>
  );
}

export default Sidebar;
